{
	"openapi": "3.0.1",
	"servers": [
		{
			"description": "API de paciente para produtos TOTVS",
			"url": "{{host}}/api/hcg/v1",
			"variables": {
				"domain": {
					"default": "localhost"
				},
				"port": {
					"default": "8051"
				}
			}
		}
	],
	"info": {
		"description": "API de paciente para produtos TOTVS",
		"version": "1.000",
		"title": "Patient",
		"contact": {
			"name": "T-Talk",
			"url": "https://api.totvs.com.br",
			"email": "comiteintegracao@totvs.com.br"
		},
		"x-totvs": {
			"messageDocumentation": {
				"name": "Patient",
				"description": "Informações de Pacientes",
				"segment": "Saúde"
			},
			"productInformation": [
				{
					"product": "RM",
					"contact": "TOTVS.SAUDE.SQUAD.GHASSIST@totvs.com.br",
					"description": "Informações de Pacientes",
					"adapter": ""
				}
			]
		}
	},
	"paths": {
		"/patients/{code}": {
			"get": {
				"tags": [
					"Patient"
				],
				"summary": "Retorna os dados de um paciente",
				"description": "Retorna os dados de um paciente",
				"operationId": "GetPatient",
				"x-totvs": {
					"productInformation": [
						{
							"product": "RM",
							"available": true,
							"note": "Este verbo está disponível com todos os parâmetros",
							"minimalVersion": "12.1.26"
						}
					]
				},
				"parameters": [
					{
						"$ref": "#/components/parameters/code"
					}
				],
				"responses": {
					"200": {
						"description": "Registro recuperado com sucesso",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/Patient_1_000.json#/definitions/PatientInfo"
								}
							}
						}
					},
					"500": {
						"description": "Erro na execução da operação",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/definitions/ErrorModel"
								}
							}
						}
					}
				}
			}
		},
		"/patients": {
			"get": {
				"tags": [
					"Patient"
				],
				"summary": "Recupera uma lista de registros",
				"description": "Recupera uma lista de registros",
				"operationId": "GetAllPatients",
				"x-totvs": {
					"productInformation": [
						{
							"product": "RM",
							"available": true,
							"note": "Este verbo está disponível com todos os parâmetros.",
							"minimalVersion": "12.1.26"
						}
					]
				},
				"parameters": [
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Authorization"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Order"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Page"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/PageSize"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Fields"
					}
				],
				"responses": {
					"200": {
						"description": "Registros recuperados com sucesso",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/Patient_1_000.json#/definitions/PagedPatient"
								}
							}
						}
					},
					"500": {
						"description": "Erro no momento da recuperação do registro.",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/definitions/ErrorModel"
								}
							}
						}
					}
				}
			},
			"post": {
				"tags": [
					"Patient"
				],
				"summary": "Insere um registro",
				"description": "Insere um registro",
				"operationId": "Post",
				"x-totvs": {
					"productInformation": [
						{
							"product": "RM",
							"available": true,
							"note": "Este verbo esta disponivel com todos parametros",
							"minimalVersion": "12.1.26"
						}
					]
				},
				"parameters": [
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Authorization"
					}
				],
				"requestBody": {
					"description": "Objeto para inserir um registro",
					"content": {
						"application/json": {
							"schema": {
								"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/Patient_1_000.json#/definitions/PatientInfo"
							}
						}
					}
				},
				"responses": {
					"201": {
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/Patient_1_000.json#/definitions/PatientInfo"
								}
							}
						}
					},
					"400": {
						"description": "Erro no momento da alteração",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/definitions/ErrorModel"
								}
							}
						}
					}
				}
			}
		}
	},
	"components": {
		"parameters": {
			"code": {
				"name": "code",
				"in": "path",
				"description": "Identicador do registro",
				"required": true,
				"schema": {
					"type": "string"
				}
			},
			"x-totvs": {
				"productInformation": [
					{
						"product": "RM",
						"available": true,
						"note": "Identificador único do paciente",
						"minimalVersion": "12.1.26"
					}
				]
			}
		},
		"schemas": {}
	}
}
